<script>
let password = null;
let key = null;
let vector= new Uint8Array(16);
let vectorints= [6, 4, 10, 6, 2, 20, 18, 14, 3, 20, 18, 28, 3, 20, 18, 3]; 
for(i= 0; i< vectorints.length; i++) {
    vector[i]= vectorints[i];
}
let data;
let encrypted_data = null;
var decrypted_data = null;


function convertStringToArrayBufferView(str) {
    let bytes = new Uint8Array(str.length);
    let i= 0;
    try {
       for (i = 0; i < str.length; i++) {
            bytes[i] = str.charCodeAt(i);
        }
    }
    catch(ex) {
        console.log("i: "+i+ " "+ex);
    }
    return bytes;
};

function convertArrayBufferViewtoString(buffer) {
    let i= 0;
    let str= "";
    for (i = 0; i < buffer.byteLength; i++) {
        str += String.fromCharCode(buffer[i]);
    }
    return str;
};

function encrypt(stringtoencrypt) {
    crypto.subtle.digest({name: "SHA-256"}, convertStringToArrayBufferView(password)).then(function(result){
    window.crypto.subtle.importKey("raw", result, {name: "AES-CBC"}, false, ["encrypt", "decrypt"]).then(function(e){
        key = e;
        data= stringtoencrypt;
        encrypt_data();
    }, function(e){
            console.log(e);
    });
}); 
};

function decrypt(stringtodecrypt) {
    crypto.subtle.digest({name: "SHA-256"}, convertStringToArrayBufferView(password)).then(function(result){
        window.crypto.subtle.importKey("raw", result, {name: "AES-CBC"}, false, ["encrypt", "decrypt"]).then(function(e){
            key = e;
            encrypted_data= convertStringToArrayBufferView(decodeURIComponent(stringtodecrypt));            
            decrypt_data();
        }, function(e){
                console.log(e);
        });
    }); 
};
    
function encrypt_data() {
    crypto.subtle.encrypt({name: "AES-CBC", iv: vector}, key, convertStringToArrayBufferView(data)).then(
        function(result){
            encrypted_data = new Uint8Array(result);
            console.log("Encoded Encrypted data: "+encodeURIComponent(convertArrayBufferViewtoString(encrypted_data)));
            key= null;
            password= null;
        }, 
        function(e){
            console.log(e.message);
        }
    );
}       

function decrypt_data() {
    crypto.subtle.decrypt({name: "AES-CBC", iv: vector}, key, encrypted_data).then(
        function(result){
            delete document.getElementById("all").remove();

            decrypted_data = new Uint8Array(result);
            var image = new Image(); 
            image.src = "data:"+convertArrayBufferViewtoString(decrypted_data); 
            //image.setAttribute("style", "transform: rotate(90deg)");
            let div= document.createElement("div");
            div.setAttribute("style", "text-align: center;");
        
            let button= document.createElement("button");
            button.innerHTML="Back";
            button.setAttribute("onclick", "location.reload()");
        
            let br= document.createElement("br");
            div.appendChild(image);
            div.appendChild(br);
            div.appendChild(button);
            
            document.body.appendChild(div);
            button.focus();
            key= null;
            password= null;
        },
        function(e){
            location.reload();
        }
    );
}

function doNext() {
    delete document.getElementById("pdiv").remove();

    let all= document.getElementById("all");
    let button= document.createElement("button");
    let br= document.createElement("br");
    button.style="width: 164px;"
    button.innerHTML="Decrypt";
    button.setAttribute("onclick", "decrypt(encryptedimg)");
    all.append(br);
    br= document.createElement("br");
    all.append(br);
    all.appendChild(button);
    let file= document.createElement("input");
    file.type="file";
    file.style="width: 164px;"
    file.setAttribute("onchange","encodeImageFileAsURL(this)");
    br= document.createElement("br");
    all.append(br);
    br= document.createElement("br");
    all.append(br);
    all.appendChild(file);
    button.focus();
}    

function encodeImageFileAsURL(element) {
    var file = element.files[0];
    var reader = new FileReader();
    reader.onloadend = function() {
        data= reader.result;
        console.log("Data to encrypt: "+data)
        encrypt(data.toString());
    }
    reader.readAsDataURL(file);
  }

function keyPressed(e) {
    let keynum = e.keyCode || e.which;  
    if(keynum == 13) 
        document.getElementById('ok').onclick();
};
